import React from 'react'
import { useNavigate } from 'react-router-dom';
import DetailedVideoContent from './DetailedVideoContent';
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom'

const Video = (props) => {
  const video_url  = props.video_url;

  const navigateToNewPage = () => {
    const navigate = useNavigate();
    navigate('/DetailedVideoContent');
  };

  return (
    <div className="videoContent">
      <div className="videoUpperContent">
        <video width="558" height="290" controls>
          <source type="video/mp4" src={video_url.slice(0,25) + "uc?export=view&id=" + video_url.slice(32,65)}></source>
        </video>
      </div>

      <div className="videoLowerContent">
        <button id='view-VideoDetails' onclick={navigateToNewPage}>View Details</button>  

        <Routes>
          <Route path="/DetailedVideoContent" element={<DetailedVideoContent />} />
        </Routes>
      </div>  
    </div>
  )
}

export default Video

